{
  "identity": "Microsoft.Cache.0.4.0-preview",
  "publisher": "Microsoft",
  "publisherDisplayName": "Microsoft",
  "itemName": "Cache",
  "itemDisplayName": "Redis Cache (Preview)",
  "version": "0.4.0-preview",
  "summary": "Distributed, in-memory Redis Cache service for modern cloud applications",
  "longSummary": null,
  "description": "<p>Microsoft Azure Redis Cache (preview) is based on the popular <a href=\"http://redis.io/\" target=\"_blank\">open source Redis Cache</a>. It gives users access to a secure, dedicated Redis Cache, managed by Microsoft.  Users get the best of both worlds, the rich Redis feature set and ecosystem, and reliable hosting and monitoring from Microsoft.</p>\n<p>Microsoft Azure Redis Cache (Preview) is available in two tiers:</p>\n<ul>\n<li>Basic – A single Cache node.</li>\n<li>Standard – A replicated Cache (Two nodes, Master and a Slave).</li>\n</ul>\n<p>Microsoft Azure Redis Cache helps your application stay responsive even as user load increases. It does so, by leveraging the low latency, high-throughput capabilities of the Redis engine. This separate distributed cache layer allows your data tier to scale independently for more efficient use of compute resources in your application layer.</p>",
  "resourceGroupName": null,
  "definitionTemplates": {
    "uiDefinitionFileUrl": "https://gallerystoreprodch.blob.core.windows.net/prod-microsoft-windowsazure-gallery/8D6B920B-10F4-4B5A-B3DA-9D398FBCF3EE.PUBLICGALLERYITEMS.MICROSOFT.CACHE.0.4.0-PREVIEW/UIDefinition.json",
